import React, { useState } from 'react';

const Navbar = () => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const closeMenu = () => setMobileMenuOpen(false);

  return (
    <nav className="navbar">
      {/* Logo */}
      <div className="navbar-logo">
        <div className="logo">MyLogo</div>
      </div>

      {/* Desktop nav links */}
      <ul className="nav-links">
        <li><a href="/home">Home</a></li>
        <li><a href="/products">Products</a></li>
        {/* add more links */}
      </ul>

      {/* Desktop actions */}
      <div className="navbar-actions">
        <button className="cart-button">Cart</button>
        <button className="login-button">Login</button>
        <a href="/profile" className="profile-button">My Profile</a>
        <a href="/orders" className="orders-button">My Orders</a>
      </div>

      {/* Hamburger toggle button */}
      <button
        className="menu-toggle"
        onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
        aria-label="Toggle menu"
      >
        &#9776;
      </button>

      {/* Mobile menu */}
      {mobileMenuOpen && (
        <div className="mobile-menu">
          <ul>
            <li><a href="/home" onClick={closeMenu}>Home</a></li>
            <li><a href="/products" onClick={closeMenu}>Products</a></li>
            <li><a href="/profile" onClick={closeMenu}>My Profile</a></li>
            <li><a href="/orders" onClick={closeMenu}>My Orders</a></li>
            <li><button onClick={closeMenu}>Logout</button></li>
          </ul>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
